# Director.create(name: "Sam Brown", img_url: "https://pbs.twimg.com/profile_images/993874549916815361/A--hSmMc.jpg", bio: "Sam Brown was born in London, United Kingdom and is a British music video director, film director.")

# Director.create(name: "Jonathan Lia", img_url: "https://m.media-amazon.com/images/M/MV5BNDc3ZmI0YmYtZmI0My00ODg2LWI3ZDMtOWIxOWM5NmExODZlXkEyXkFqcGdeQXVyMTQ1MDc3NzQ@._V1_UY317_CR29,0,214,317_AL_.jpg", bio: "Jonathan has produced more than 100 music videos for artists such as Beyonce, Jay Z, Kanye West, Madonna, Coldplay, Depeche Mode, The Lonely Island, Jennifer Lopez, 50 cent, Marilyn Manson, Lenny Kravitz, Ashlee Simpson, Good Charlotte, My Chemical Romance, Kylie Minogue, Matchbox 20 and many more. He was nominated for a Grammy for producing Depeche Mode's 'Wrong' video and has been nominated for multiple MTV VMA awards both as a director and producer.")

# Director.create(name: "Hype Williams", img_url: "https://www.billboard.com/files/styles/article_main_image/public/media/hype-williams-billboard-1548.jpg", bio: "Harold 'Hype' Williams (born July 1970) is an American music video director, film director, film producer, and screenwriter.")

# Director.create(name: "Director X", img_url: "https://pbs.twimg.com/profile_images/1036258872896278530/M2WFv9zv_400x400.jpg", bio: "Julien Christian Lutz (born October 31, 1975), credited professionally as Director X, is a Canadian film and music video director and producer.")

# Director.create(name: "Melina Matsoukus", img_url: "https://pmcvariety.files.wordpress.com/2019/06/melina-matsoukas-afi-franklin-j-schaffner-alumni-medal.jpg?w=1000", bio: "Melina Matsoukas (born January 14, 1981) is an American music video, film, commercial and television director. She is a two-time Grammy Award winner and four-time MTV Video Music Awards winner for her 'We Found Love' and 'Formation' music videos.[1] She was honored with the Franklin J. Schaffner Alumni Medal by the American Film Institute in 2019.")

# Director.create(name: "McG", img_url: "http://www.gstatic.com/tv/thumb/persons/217939/217939_v9_bb.jpg", bio: "Joseph McGinty Nichol (born August 9, 1968), known professionally as McG, is an American director, producer, and former record producer.")

# Director.create(name: "David Fincher", img_url: "https://m.media-amazon.com/images/M/MV5BZDQzODljOTUtMTJkYS00YzE1LTlhNDgtNjQyOWQ1MGFhY2QyXkEyXkFqcGdeQXVyNjg0NzUzOTY@._V1_UY268_CR147,0,182,268_AL_.jpg", bio: "David Andrew Leo Fincher[1][2] (born August 28, 1962) is an American film director, film producer, television director, television producer, and music video director. He was nominated for the Academy Award for Best Director for The Curious Case of Benjamin Button (2008) and The Social Network (2010). For the latter, he won the Golden Globe Award for Best Director and the BAFTA Award for Best Direction.")

# Director.create(name: "Joseph Kahn", img_url: "https://pixel.nymag.com/imgs/daily/vulture/2018/11/01/01-joesph-kahn.w700.h700.jpg", bio: "Joseph Jun-hee Kahn (born Ahn Jun-hee, Korean: 안준희; born October 12, 1972) is a Korean-American film and music video director. Kahn has worked with various artists such as Britney Spears, Jennifer Lopez, Lady Gaga, Kylie Minogue, Samantha Mumba, Taylor Swift, Shakira, Aaliyah, Dr. Dre, Snoop Dogg, Kelly Clarkson, Mariah Carey, Christina Aguilera, 50 Cent, Destiny's Child, Backstreet Boys, and George Michael.")

